import React from 'react';

const Buscador = () => {
    return (  
        <div className="main">
       <div className="form-group has-search">
        <span className="fa fa-search form-control-feedback" />
        <input type="text" className="form-control" placeholder="Search" />
      </div>
      </div>
    );
}
 
export default Buscador;
